export default function UserDynamiqueTab(props){
    return(
    <tr>
        <td>{props.entry.yearly}</td>
        <td>{props.entry.expected}</td>
        <td>{props.entry.current}</td>
        <td>{props.entry.investment}</td>
        <td>TOTAL INVESTED CAPITAL</td>
    </tr>
    )
}
